(9, 5, 'fw:opt:ext:pb:page-builder:json', '[{\"type\":\"section\",\"atts\":{\"is_fullwidth\":false,\"background_color\":\"\",\"background_image\":{\"type\":\"custom\",\"custom\":\"\",\"predefined\":\"\",\"data\":{\"icon\":\"\",\"css\":[]}},\"video\":\"\",\"custom_class\":\"bg-dark\"},\"_items\":[{\"type\":\"column\",\"width\":\"1_1\",\"fw-collapse\":false,\"atts\":{\"custom_class\":\"intro\",\"anchor\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"text_block\",\"atts\":{\"text\":\"<h1 style=\\\"text-align: center;\\\">TOKENZ<\\/h1><h3 style=\\\"text-align: center;\\\">17M USD MAX CAP<\\/h3><h4 style=\\\"text-align: center;\\\"><strong>$19,683,157<\\/strong> Raised From <strong>10,463<\\/strong>\\u00a0participants<\\/h4>\"}},{\"type\":\"simple\",\"shortcode\":\"button\",\"atts\":{\"label\":\"Download Whitepaper\",\"link\":\"#\",\"target\":\"_self\",\"color\":\"yellow\"}}]},{\"type\":\"column\",\"width\":\"1_1\",\"atts\":{\"custom_class\":\"countdown\",\"anchor\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"text_block\",\"atts\":{\"text\":\"<h3 style=\\\"text-align: center;\\\">Tokens crowdsale staets in:<\\/h3><p style=\\\"text-align: center;\\\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.<\\/p><p style=\\\"text-align: center;\\\"><code><span class=\\\"highlight\\\">[tminus t=\\\"14-02-2018 00:00:00\\\" omitweeks=\\\"true\\\"]<\\/span><\\/code>already<code><span class=\\\"highlight\\\">[\\/tminus]<\\/span><\\/code><\\/p>\"}},{\"type\":\"simple\",\"shortcode\":\"button\",\"atts\":{\"label\":\"Apply now\",\"link\":\"#\",\"target\":\"_self\",\"color\":\"\"}}]},{\"type\":\"column\",\"width\":\"1_1\",\"atts\":{\"custom_class\":\"press\",\"anchor\":\"in-press\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"text_block\",\"atts\":{\"text\":\"<h3 style=\\\"text-align: center;\\\">In the press<\\/h3>\"}},{\"type\":\"simple\",\"shortcode\":\"media_image\",\"atts\":{\"image\":{