(117, 1, '2018-01-26 18:55:24', '2018-01-26 15:55:24', '<strong>Bitconnect is facing litigation from six individuals accusing the company of operating a Ponzi scheme in addition to numerous violations of securities laws. The six plaintiffs collectively invested approximately $771,000 USD into Bitconnect, and are seeking recourse following the sudden removal of the company’s lending platform that immediately led to a more than 90% loss in the value of Bitconnect tokens.</strong>\r\n\r\n<!--more-->\r\n\r\nThe <a href=\"https://www.scribd.com/document/369956633/Class-Action-Complaint-BitConnect#from_embed\" target=\"_blank\" rel=\"noopener\">complaint</a> has been filed by Charles Wildes, Francisco Doria, Aric Harod, Akiva Katz, James Gurry, and Ronald Nelson with the Southern District Court of Florida, and is made on behalf of all Bitconnect customers, in addition to the aforementioned plaintiffs individually.\r\n\r\nThe suit has been brought against all three corporate entities comprising the Bitconnect company, in addition to defendants “Glenn Arcaro, Trevon Brown a/k/a Trevon James, Ryan Hildreth, Craig Grant, and Cryptonick” – who are accused of aggressively recruiting new investors into the Ponzi scheme using social media.\r\n<h2>Bitconnect Accused of Running “Wide-Reaching Ponzi Scheme”</h2>\r\nThe preliminary statement of the complaint describes Bitconnect as having raised “millions of dollars’ worth of cryptocurrency” through “a trading platform and lending program fraudulently promoted and operated by” the defendants.\r\n\r\nThe complaint states that “Bitconnect guaranteed investors up to a forty percent total return per month on their investments, following a four-tier investment system based on the sum of the initial deposit.” Investors were “promised a one percent return on investment on a daily basis, which Bitconnect purported would be generated by its own proprietary trading bot and volatility software,” which was to be paid out “regardless of market performance or the fluctuating price of cryptocurrency.” An investment of just one thousand dollars would grow to generate a $50 million return within three years of compounding daily interest, the company is reported to have shilled.\r\n\r\nThe plaintiffs state that Bitconnect’s former $2.5 billion market capitalization was “built through the use of fraudulent means,” in particular “a wide-reaching Ponzi scheme that defrauded investors, made a mockery of state and federal securities laws, and employed an army of social media mercenaries who were paid to bring more unsuspecting victims into the fraud.”', 'Bitconnect Faces Lawsuit for Operating “Wide-Reaching Ponzi Scheme”', '', 'publish', 'open', 'open', '', 'bitconnect-faces-lawsuit-for-operating-wide-reaching-ponzi-scheme', '', '', '2018-01-26 18:55:24', '2018-01-26 15:55:24', '', 0, 'http://unyson/?p=117', 0, 'post', '', 0),
