rformance or the fluctuating price of cryptocurrency.” An investment of just one thousand dollars would grow to generate a $50 million return within three years of compounding daily interest, the company is reported to have shilled.\r\n\r\nThe plaintiffs state that Bitconnect’s former $2.5 billion market capitalization was “built through the use of fraudulent means,” in particular “a wide-reaching Ponzi scheme that defrauded investors, made a mockery of state and federal securities laws, and employed an army of social media mercenaries who were paid to bring more unsuspecting victims into the fraud.”', 'Bitconnect Faces Lawsuit for Operating “Wide-Reaching Ponzi Scheme”', '', 'inherit', 'closed', 'closed', '', '117-revision-v1', '', '', '2018-01-26 18:55:24', '2018-01-26 15:55:24', '', 117, 'http://unyson/2018/01/26/117-revision-v1/', 0, 'revision', '', 0),
